import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';
import { motion } from 'framer-motion';

function Predictor() {
  const [college, setCollege] = useState('');
  const [branch, setBranch] = useState('');
  const [category, setCategory] = useState('');
  const [minRank, setMinRank] = useState('');
  const [maxRank, setMaxRank] = useState('');

  const navigate = useNavigate();

  const handleSubmit = (e) => {
    e.preventDefault();
    const query = `?college=${college}&branch=${branch}&category=${category}&minRank=${minRank}&maxRank=${maxRank}`;
    navigate(`/colleges${query}`);
  };

  return (
    <div className="flex flex-col items-center justify-center min-h-screen bg-gradient-to-r from-purple-600 to-blue-500 text-white px-4">
      <motion.h2
        className="text-3xl font-bold mb-6"
        initial={{ opacity: 0, y: -30 }}
        animate={{ opacity: 1, y: 0 }}
        transition={{ duration: 0.8 }}
      >
        College Predictor Form
      </motion.h2>

      <motion.form
        onSubmit={handleSubmit}
        className="flex flex-col gap-4 w-full max-w-md"
        initial={{ opacity: 0 }}
        animate={{ opacity: 1 }}
        transition={{ delay: 0.5 }}
      >
        <input className="p-3 rounded text-black" type="text" placeholder="College Name" value={college} onChange={(e) => setCollege(e.target.value)} />
        <input className="p-3 rounded text-black" type="text" placeholder="Branch" value={branch} onChange={(e) => setBranch(e.target.value)} />
        <input className="p-3 rounded text-black" type="text" placeholder="Category" value={category} onChange={(e) => setCategory(e.target.value)} />
        <input className="p-3 rounded text-black" type="number" placeholder="Min Rank" value={minRank} onChange={(e) => setMinRank(e.target.value)} />
        <input className="p-3 rounded text-black" type="number" placeholder="Max Rank" value={maxRank} onChange={(e) => setMaxRank(e.target.value)} />
        <motion.button
          className="bg-white text-purple-600 px-4 py-3 rounded-xl hover:bg-gray-200"
          whileHover={{ scale: 1.05 }}
          whileTap={{ scale: 0.95 }}
        >
          Predict Colleges
        </motion.button>
      </motion.form>
    </div>
  );
}

export default Predictor;
